    false,nt"url": null,nt"notes": "This annual narrative report for Port Louisa
    National Wildlife Refuge outlines Refuge accomplishments during the 1971 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water quality, and food and cover during the year. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, raptors, fish, and reptiles-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, collections and receipts, vegetation control, and prescribed
    fires. Resource management is outlined; topics include fur harvesting. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, hunting, violations, and safety. Items of interest and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
